    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Bedrock map,
    Structure map, Cross Section image, and a text on the Bedrock geology for the Vicinity
    of Wilmington and Woodford, Vermont. For more information see links provided. Abstract:
    The Wilmington-Woodford area of southernmost Vermont comprises 385 square miles
    of metamorphosed pre-Cambrian and Lower Paleozoic strata. The area lies across the
    Green Mountain Anticlinorium  although the greater part of it is east of the axis
    of this major fold. The Green Mountains represent the eroded remnant of the anticlinorium
    which is overturned and locally overthrust to the west.",nt"license_title":
